"use strict";
var fs = require('fs');
class PhotoGenerator {
	constructor() {
		this.base64testfile = base64testfile;
	}
	makeRandName()
	{
	    var text = "";
	    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
	    for( var i=0; i < 20; i++ ) {
	        text += possible.charAt(Math.floor(Math.random() * possible.length));
	    }
	    return text;
	}
	savePhoto(base64, callback) {
		if(typeof base64 !== "string" || base64 === "") { 
			callback(""); 
			return; 
		}
		var date = new Date();
		var buf = new Buffer(base64, 'base64'); // Ta-da
		var random_name = this.makeRandName();
		var name = `fs/${date.getSeconds()}-${date.getDay()}-${random_name}-${date.getMonth()}-${date.getYear()}.jpg`;
		fs.writeFile(name, buf, (err) => {
			if(err) { callback("error"); }
			callback(name);
		});
	}
}

module.exports = PhotoGenerator;

var base64testfile = "";